import { View, Text, Image } from "@react-pdf/renderer"
import React from "react"
import styles from "../../styles/pdf/basic"

const Personal = () => {
  return (
    <View>
      <Image src="" style={styles.image} />
      <Text />
    </View>
  )
}

export default Personal
